import React from "react";
import BooleanComponent from "./03/BooleanComponent";

class App extends React.Component {
  render() {
    const array = [1, 2, 3];
    const obj = { name: "제목", age: 30 };
    const node = <h1>노드</h1>;
    const func = () => {
      console.log("메시지");
    };
    return (
      <ChildComponent
        //1.불리언값 전달
        boolValue={true}
        //2.숫자 전달
        numValue={1}
        //3.배열 전달
        arrayValue={array}
        //4.객체 전달
        objValue={obj}
        //5.노드 전달
        nodeValue={node}
        //6.함수 객체 전달
        funcValue={func}
      />
    );
  }
}

export default App;
